  Component
} 
from 'react';

class App extends Component {
  render() {

    const fn = event => {
      if (event.isComposing) {
        alert('Undo!')
      }
    }

    return (
      <h1 onKeyDown={fn}>asdasd</h1>
    );
  }
}

export default App;
